import React, { useState, useEffect } from "react";
import { searchOrderYarn } from "../API/OrderYarnApi";

const ShowOrderYarn = () => {
  const orderNo = '67';
  const [orderYarnData, setOrderYarnData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (!orderNo) return;

    const fetchOrderYarnData = async () => {
      try {
        setLoading(true);
        setError(null);
        const response = await searchOrderYarn(orderNo);
        setOrderYarnData(response.data);
      } catch (err) {
        setError("Error fetching order yarn data");
        console.error("Error fetching order yarn data:", err);
      } finally {
        setLoading(false);
      }
    };

    fetchOrderYarnData();
  }, [orderNo]);

  if (loading) return <p>Loading order yarn data...</p>;
  if (error) return <p>{error}</p>;

  // Function to render yarn rows with size data and total weight
  const renderYarnRow = (matchingName, yarnKey, yarnData, rowspan) => {
    const sizes = ["XS", "S", "M", "L"];
    const sizeData = sizes.map((size) => (
      <td key={size}>{(yarnData[size] || 0).toFixed(2)}</td>
    ));

    const totalWeight = (yarnData.Weight || 0).toFixed(2);

    return (
      <tr key={yarnKey}>
        {/* Apply dynamic font color to Matching Name */}
        <td rowSpan={rowspan} style={{ color: matchingName }}>
          {matchingName}
        </td>
        <td>{yarnKey}</td>
        {sizeData}
        <td>{totalWeight}</td>
      </tr>
    );
  };

  // Group yarn data by MatchingName
  const groupYarnDataByMatchingName = () => {
    if (!orderYarnData) return [];

    const groupedData = [];
    let currentMatchingName = null;
    let yarnDataForCurrentMatchingName = [];

    orderYarnData.forEach((item) => {
      if (item.MatchingName !== currentMatchingName) {
        if (currentMatchingName) {
          groupedData.push({ matchingName: currentMatchingName, yarnData: yarnDataForCurrentMatchingName });
        }
        currentMatchingName = item.MatchingName;
        yarnDataForCurrentMatchingName = [item];
      } else {
        yarnDataForCurrentMatchingName.push(item);
      }
    });

    if (currentMatchingName) {
      groupedData.push({ matchingName: currentMatchingName, yarnData: yarnDataForCurrentMatchingName });
    }

    return groupedData;
  };

  const groupedYarnData = groupYarnDataByMatchingName();

  return (
    <div>
      <h2>Search Order Yarn Data</h2>
      {orderYarnData ? (
        <div>
          <h3>Order Yarn Data for OrderNo: {orderNo}</h3>
          <table>
            <thead>
              <tr>
                <th>Matching Name</th>
                <th>Yarn ID</th>
                <th>XS</th>
                <th>S</th>
                <th>M</th>
                <th>L</th>
                <th>Total</th>
              </tr>
            </thead>
            <tbody>
              {groupedYarnData.map((group, groupIndex) => {
                return group.yarnData.map((yarnItem, yarnIndex) => {
                  const rowSpan = group.yarnData.length;

                  return (
                    <React.Fragment key={`${groupIndex}-${yarnIndex}`}>
                      {yarnIndex === 0 && (
                        <tr key={`${groupIndex}-matchingName`}>
                          <td rowSpan={rowSpan} style={{ color: group.matchingName }}>
                            {group.matchingName}
                          </td>
                        </tr>
                      )}
                      {renderYarnRow(
                        group.matchingName,
                        yarnItem.YarnId,
                        yarnItem,
                        rowSpan
                      )}
                    </React.Fragment>
                  );
                });
              })}
            </tbody>
          </table>
        </div>
      ) : (
        <p>No data found for this OrderNo.</p>
      )}
    </div>
  );
};

export default ShowOrderYarn;
